PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?person ?personLabel ?dateOfDeath WHERE {
  VALUES ?person {
    wd:Q108749290 wd:Q123575771 wd:Q2935026
  }
  OPTIONAL {
    ?person wdt:P570 ?dateOfDeath .
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?numPartners ( COUNT( ?femaleArtist ) AS ?numFemaleArtists ) ( COUNT( ?maleArtist ) AS ?numMaleArtists ) WHERE {
  {
    SELECT ?artist ?gender ( COUNT( ?partner ) AS ?numPartners ) WHERE {
      ?artist wdt:P106 ?occupation ; wdt:P21 ?gender ; wdt:P451 ?partner .
      FILTER EXISTS {
        ?occupation wdt:P279 * wd:Q108289408
      }
    }
    GROUP BY ?artist ?gender
  }
  VALUES ?gender {
    wd:Q6581072 wd:Q6581097
  }
  BIND( IF( ?gender = wd:Q6581072 , ?artist , ?femaleArtist ) AS ?femaleArtist ) BIND( IF( ?gender = wd:Q6581097 , ?artist , ?maleArtist ) AS ?maleArtist )
}
GROUP BY ?numPartners
ORDER BY ?numPartners

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?lighthouse ?lighthouseLabel ?color WHERE {
  ?lighthouse wdt:P31 wd:Q19350 .
  ?lighthouse wdt:P131 * wd:Q504676 .
  OPTIONAL {
    ?lighthouse wdt:P462 ?color
  }
  OPTIONAL {
