PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT ?legalFormLabel ?finalCount WHERE {
  {
    SELECT ?legalForm ( COUNT( ?entity ) AS ?count ) WHERE {
      ?entity wdt:P17 wd:Q142 .
      ?entity wdt:P1454 ?legalForm .
    }
    GROUP BY ?legalForm
    HAVING ( ?count > 499 )
  } UNION {
    SELECT ( strdt( "OTHER" , xsd:string ) AS ?legalFormLabel ) ( SUM( ?otherCount ) AS ?otherSum ) WHERE {
      {
        SELECT ?legalForm ( COUNT( ?entity ) AS ?otherCount ) WHERE {
          ?entity wdt:P17 wd:Q142 .
          ?entity wdt:P1454 ?legalForm .
        }
        GROUP BY ?legalForm
        HAVING ( ?otherCount <= 499 )
      }
    }
  }
  OPTIONAL {
    ?legalForm rdfs:label ?legalFormLabel .
    FILTER ( LANG( ?legalFormLabel ) = "fr" )
  }
  BIND( IF( BOUND( ?count ) , ?count , ?otherSum ) AS ?finalCount )
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX geof: <http://www.opengis.net/def/function/geosparql/>
SELECT ?settlement ?settlementLabel ?settlementType ?settlementTypeLabel ?settlementCoords ?centerCoords ?distance WHERE {
  wd:Q2180733 wdt:P625 ?centerCoords .
  ?settlement wdt:P17 wd:Q213 ; wdt:P625 ?settlementCoords ; wdt:P31 ?settlementType .
  FILTER ( ?settlementType IN ( wd:Q515 , wd:Q3957 , wd:Q486972 ) ) BIND( geof:distance ( ?settlementCoords , ?centerCoords ) AS ?distance ) FILTER ( ?distance <= 35 ) OPTIONAL {
    ?settlement rdfs:label ?settlementLabel .
    FILTER ( LANG( ?settlementLabel ) = "en" )
  }
  OPTIONAL {
    ?settlementType rdfs:label ?settlementTypeLabel .
    FILTER ( LANG( ?settlementTypeLabel ) = "en" )
  }
}
ORDER BY ASC ( ?distance )

