PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ?capital ( SAMPLE( ?currency ) AS ?sampledCurrency ) ?population ?flagImage ?capitalDeterminationMethod WHERE {
  ?country wdt:P31 wd:Q3624078 ; wdt:P36 ?capital ; wdt:P1082 ?population ; wdt:P41 ?flagImage .
  OPTIONAL {
    ?country wdt:P38 ?currency .
  }
  OPTIONAL {
    ?capital wdt:P459 ?capitalDeterminationMethod .
  }
  FILTER NOT EXISTS {
    ?country wdt:P31 wd:Q3024240
  }
  FILTER NOT EXISTS {
    ?country wdt:P31 wd:Q34641
  }
}
GROUP BY ?country ?capital ?population ?flagImage ?capitalDeterminationMethod
ORDER BY ?country
LIMIT 10

