PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ?countryLabel ?population ?populationRank WHERE {
  ?country wdt:P463 wd:Q458 .
  ?country wdt:P1082 ?population .
  {
    SELECT ?country ( COUNT( ?otherCountry ) + 1 AS ?populationRank ) WHERE {
      ?country wdt:P463 wd:Q458 .
      ?country wdt:P1082 ?population .
      ?otherCountry wdt:P463 wd:Q458 .
      ?otherCountry wdt:P1082 ?otherPopulation .
      FILTER ( ?otherPopulation >= ?population )
    }
    GROUP BY ?country
  }
  .
  OPTIONAL {
    ?country rdfs:label ?countryLabel .
    FILTER ( LANG( ?countryLabel ) = 'en' )
  }
}
ORDER BY ?populationRank

PREFIX wd: <http://www.wikidata.org/entity/>
