PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?object ?part ?elevation1 ?elevation2 ?difference WHERE {
  ?object p:P2044 ?statement1 .
  ?statement1 ps:P2044 ?elevation1 .
  OPTIONAL {
    ?statement1 pq:P518 ?part1 .
  }
  OPTIONAL {
    ?statement1 pq:P6238 ?unit1 .
  }
  ?object p:P2044 ?statement2 .
  ?statement2 ps:P2044 ?elevation2 .
  FILTER ( ?statement1 != ?statement2 ) OPTIONAL {
    ?statement2 pq:P518 ?part2 .
  }
  OPTIONAL {
    ?statement2 pq:P6238 ?unit2 .
  }
  BIND( IF( BOUND( ?part1 ) , ?part1 , IF( BOUND( ?part2 ) , ?part2 , "" ) ) AS ?part ) BIND( IF( ?unit1 = "http://www.wikidata.org/entity/Q712226" , ?elevation1 * 0.3048 , ?elevation1 ) AS ?elevation1_m ) BIND( IF( ?unit2 = "http://www.wikidata.org/entity/Q712226" , ?elevation2 * 0.3048 , ?elevation2 ) AS ?elevation2_m ) BIND( ABS( ?elevation1_m - ?elevation2_m ) AS ?difference ) FILTER ( ?difference > 500 )
}
ORDER BY DESC ( ?difference )
LIMIT 100

