SELECT ?event ?eventTime ( SUM( ?age ) AS ?sumOfAges ) WHERE {
  wd:Q41174436 wdt:P527 ?event .
  ?event wdt:P585 ?eventTime .
  {
    ?event wdt:P1346 ?participant .
    BIND( 1 AS ?rank )
  } UNION {
    ?event wdt:P2321 ?classification .
    ?classification wdt:P3841 ?participant .
    ?classification wdt:P3842 ?rank .
    FILTER ( ?rank >= 1 && ?rank <= 3 )
  }
  ?participant wdt:P569 ?dob .
  BIND( year( ?eventTime ) - year( ?dob ) AS ?age )
}
GROUP BY ?event ?eventTime
ORDER BY ?eventTime

