PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?municipality ?idescatCode ?population ?area ?coatOfArms WHERE {
  ?municipality wdt:P131 * wd:Q5705 ; wdt:P4335 ?idescatCode .
  FILTER ( STRSTARTS( ?idescatCode , '25' ) ) .
  OPTIONAL {
    ?municipality p:P1082 ?populationStatement .
    ?populationStatement pq:P585 ?date .
    FILTER NOT EXISTS {
      ?municipality p:P1082 ?newerPopulationStatement .
      ?newerPopulationStatement pq:P585 ?newerDate .
      FILTER ( ?newerDate > ?date )
    }
    ?populationStatement ps:P1082 ?population .
  }
  OPTIONAL {
    ?municipality wdt:P2046 ?area
  }
  .
  OPTIONAL {
    ?municipality wdt:P94 ?coatOfArms
  }
  .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?item WHERE {
  ?item rdfs:label "Madonna and Child" @en .
  FILTER NOT EXISTS {
    ?item rdfs:label ?frenchLabel .
    FILTER ( LANG( ?frenchLabel ) = "fr" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?library ?branch WHERE {
  VALUES ?parentLibrary {
    wd:Q30268112
  }
  ?library wdt:P361 ?parentLibrary .
  OPTIONAL {
    ?branch wdt:P361 + ?library .
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ?countryLabel ( COUNT( ?airport ) AS ?numAirports ) ?population WHERE {
  ?airport wdt:P31 wd:Q1248784 .
  FILTER NOT EXISTS {
    ?airport wdt:P582 []
  }
  FILTER NOT EXISTS {
    ?airport wdt:P576 []
  }
  ?airport wdt:P17 ?country .
  ?country wdt:P1082 ?population .
  OPTIONAL {
    ?country rdfs:label ?countryLabel .
    FILTER ( LANG( ?countryLabel ) = "en" )
  }
}
GROUP BY ?country ?countryLabel ?population

